import React, { useState } from 'react';
import { useNavigate, useLocation } from 'react-router-dom';
import './Navbar.css';
import logo from './logo.png';

function Navbar({ onSearch }) {
    const [searchTerm, setSearchTerm] = useState('');
    const [isDropdownOpen, setIsDropdownOpen] = useState(false); // State for dropdown visibility

    const navigate = useNavigate();
    const location = useLocation(); // Get the current location
    const isLoggedIn = !!localStorage.getItem('authToken'); // Check if user is logged in

    const handleSearchChange = (e) => {
        const value = e.target.value;
        setSearchTerm(value);
        if (onSearch) {
            onSearch(value);
        }
    };

    const handleHomeClick = (e) => {
        e.preventDefault(); // Prevent default anchor behavior
        navigate('/'); // Navigate to home page
    };

    const handleAboutClick = (e) => {
        e.preventDefault(); // Prevent default anchor behavior
        navigate('/about'); // Navigate to about page
    };

    const handleContactClick = (e) => {
        e.preventDefault(); // Prevent default anchor behavior
        navigate('/contact'); // Navigate to contact page
    };

    const handleMonitoringClick = (e) => {
        e.preventDefault(); // Prevent default anchor behavior
        setIsDropdownOpen((prev) => !prev); // Toggle dropdown visibility
    };

    const handleLessDataClick = (e) => {
        e.preventDefault(); // Prevent default anchor behavior
        navigate('/monitoring/less-data'); // Navigate to the less data comparison page
        setIsDropdownOpen(false); // Close dropdown after selection
    };

    const handleMoreDataClick = (e) => {
        e.preventDefault(); // Prevent default anchor behavior
        navigate('/monitoring/more-data'); // Navigate to the more data comparison page
        setIsDropdownOpen(false); // Close dropdown after selection
    };

    const handleLogout = () => {
        localStorage.removeItem('authToken'); // Remove token to log out
        navigate('/login'); // Redirect to login page
    };

    return ( <
            nav className = "navbar" >
            <
            img src = { logo }
            alt = "Logo"
            className = "navbar-logo" / >
            <
            ul className = "navbar-menu" > {
                isLoggedIn && ( <
                    >
                    <
                    li >
                    <
                    a href = "/"
                    onClick = { handleHomeClick }
                    className = { location.pathname === '/' ? 'active' : '' } >
                    Home <
                    /a> < /
                    li > <
                    li >
                    <
                    a href = "/about"
                    onClick = { handleAboutClick }
                    className = { location.pathname === '/about' ? 'active' : '' } >
                    About <
                    /a> < /
                    li > <
                    li >
                    <
                    a href = "/monitoring"
                    onClick = { handleMonitoringClick }
                    className = { location.pathname.includes('/monitoring') ? 'active' : '' } >
                    Monitor <
                    /a> {
                    isDropdownOpen && ( // Show dropdown when Monitoring is clicked
                        <
                        ul className = "dropdown-menu" >
                        <
                        li >
                        <
                        a href = "/monitoring/less-data"
                        onClick = { handleLessDataClick } >
                        Compare Less Data <
                        /a> < /
                        li > <
                        li >
                        <
                        a href = "/monitoring/more-data"
                        onClick = { handleMoreDataClick } >
                        Compare More Data <
                        /a> < /
                        li > <
                        /ul>
                    )
                } <
                /li> <
                li >
                <
                a href = "/upload"
                onClick = { handleAboutClick }
                className = { location.pathname === '/upload' ? 'active' : '' } >
                Da <
                /a> < /
                li > <
                li >
                <
                a href = "/contact"
                onClick = { handleContactClick }
                className = { location.pathname === '/contact' ? 'active' : '' } >
                Contact <
                /a> < /
                li > <
                />
            )
        } <
        /ul> <
    div className = "navbar-search" >
        <
        input type = "text"
    placeholder = "Search by Registration Number"
    value = { searchTerm }
    onChange = { handleSearchChange }
    /> < /
    div > {
            isLoggedIn && ( <
                button className = "logout-button"
                onClick = { handleLogout } >
                Logout <
                /button>
            )
        } <
        /nav>
);
}

export default Navbar;
